        <div>
    <section className="rcard">
      <div className="lsection">
      Explore, cook, and cherish recipes co-created by our global community of food enthusiasts.
        </div>

      <div className="rsection">
        <img src="./Images/pic2.png" alt="Developer" />
      </div>
    </section>
        
    <div class="card" style={{width: "25rem",backgroundColor:"white"}}>
  <img class="card-img-top" src="..." alt="indian"/>
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="btn btn-primary">Go somewhere</a>
  </div>
</div>




        </div>
    );
}

export default Recipes;
